import React, { Fragment } from "react";
import IconLizard from "../svg/icon-lizard";

export default function LizardIcon() {
  return (
    <Fragment>
      <div className={"lizard-icon icon"} id={"lizard"}>
        <IconLizard />
      </div>
    </Fragment>
  );
}
